import React from 'react';
import ReactDOM from 'react-dom';
import './Menu.js'
import './Menu.css'
import logo from './logo.svg';
import './App.css';

class Header extends React.Component {
  render() {
    return (
      <div id="HEADER" class="container-fluid mb-5 ">
        <Menu />
      </div>
    );
  }
}

export default Header;
